const tasks = [
  {
    id: 1,
    text: "Docter Appointment",
    day: "Feb 5th at 2h:30pm",
    reminder: true,
  },
  {
    id: 2,
    text: "Meeting At School",
    day: "Feb 6th at 1h:30pm",
    reminder: true,
  },
  { id: 3, text: "Food Shopping", day: "Feb 7th 3h:30pm", reminder: false },
];

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3 key={tasks.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
